    console.log(queryString);
    
    const split = queryString.split("=");
    const id = split[1];
    console.log(id);

    async function getStocklistName() {
        try {
            const response = await fetch(`http://localhost:5000/stocklists/get/${id}`)
        } catch (err) {
            console.error(err.message)
        }
    }

return (
